import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
        <div className="background1 hidden-sm hidden-xs"><img src="https://www.ejercito.mil.co/_templates/DEFAULT2018/recursos/images//cabezote/logo.png" alt="logo" />
        </div>

          <img src="https://www.mindefensa.gov.co/cust~mdn~ume~logon~ui/layout/escudo_mdn_2019.jpg" alt="logo" />

          <div className="form-group">
            <label htmlFor="exampleInputEmail1">Email address</label>
            <input type="email" className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" placeholder="Enter email"></input>
            <small id="emailHelp" className="form-text text-muted">We'll never share your email with anyone else.</small>
          </div>

          <div className="form-group">
            <label htmlFor="exampleInputPassword1">Password</label>
            <input type="password" className="form-control" id="exampleInputPassword1" placeholder="Password"></input>
          </div>
          <div className="form-group form-check">
            <input type="checkbox" className="form-check-input" id="exampleCheck1"></input>
            <label className="form-check-label" htmlFor="exampleCheck1">Check me out</label>
          </div>
          <button type="submit" className="btn btn-primary">Entrar al sistema</button>

        </header>

      </div>
    );
  }
}

export default App;
